<p>The <b>yellow-browed seedeater</b> (<i>Serinus whytii</i>) is a species of <span>finch</span> in the <span>Fringillidae</span> family. It is found in <span>Malawi</span>, <span>Tanzania</span>, and <span>Zambia</span>.</p>
